import axios from 'axios';
import React, { Component, useEffect } from 'react';
import DataService from '../services/remobidyc-server-services';


class ListingSimulation extends Component {
    constructor(props) {
        super(props);
        const [simulations, getSimulations] = useState('');
        this.state = {
            simulations: '',
        };

        useEffect(() => {
            axios.get('http://localhost:2222/api/runs').then((response) => {
                const allSimulations = response.data;
                getSimulations(allSimulations);
            }).catch(error => console.error(`Error: ${error}`))

        })
    }


    render() {
        return (
            <table className="table">
                <thead>
                    <tr>
                        <th scope="col">#</th>
                        <th scope="col">id</th>
                        <th scope="col">username</th>
                        <th scope="col">model</th>
                        <th scope="col">progress</th>
                    </tr>
                </thead>
                <tbody>
                    <SimulationTab simulations={simulations} />
                </tbody>
            </table>
        )
    }
}

export default ListingSimulation;
